import React from 'react';
import './About.css';

function About() {
  return (
    <section className="about-section">
      <h1>About Me</h1>
      <p>
        {/* Add your bio here */}
        I am a passionate web developer, video editor, and content writer with a knack for creating stunning digital experiences...
      </p>
    </section>
  );
}

export default About;
